import React from 'react';
import alex from '../alex.jpg'

const Card = () => {
    return (
      <div className="flex items-center justify-center h-screen rounded-lg">
        <div className="max-w-sm rounded overflow-hidden shadow-lg p-20 bg-pink-500">
          <img className="w-full rounded-full shadow-lg border-2 border-gray-50" src={alex} alt="Random" />
          
          <div className="px-6 py-4">
            <div className="font-bold text-xl mb-2 text-zinc-800">Alessia Gaudioso</div>
            <p className="text-gray-50 text-base">
            Web Developer<br />
            Writer
            </p>
          </div>
          <div className="px-6 py-4">
            <span className="inline-block bg-gray-200 rounded-full px-3 py-1 text-sm font-semibold text-gray-700 mr-2">#tag1</span>
            <span className="inline-block bg-gray-200 rounded-full px-3 py-1 text-sm font-semibold text-gray-700">#tag2</span>
          </div>
        </div>
        <div className="absolute inset-0 bg-gray-800 opacity-50"></div>
      </div>
      
    );
  };
  
  export default Card;
